        console.log("Change");
    };
    handleLoginSubmit = e =>{
        e.preventDefault();
        console.log("Submit");
    };
    render() {
        return (
            <div className='Login'>
                <form className='form-input' onSubmit={this.handleLoginSubmit}>
                    <h2>Member Login</h2>
                    <Input
                        name='email'
                        prefix={<Icon type="mail" style={{ color: 'rgba(0,0,0,.25)' }} />}
                        placeholder='Email'/>
                    <Input.Password
                        name='password'
                        prefix={<Icon type="exclamation" style={{ color: 'rgba(0,0,0,.25)' }} />}
                        placeholder="Input password" />
                    <Input.Submit type='primary'>
                        Login
                    </Input.Submit>
                </form>
            </div>
        )
    }
}
export default Login;
